const initState={
    authError:null
}

const authReducer = (state=initState, action) => {
    switch(action.type){
        case 'LOGIN_ERROR':
            console.log('error');
             return {
            ...state,
            authError:'Login failed'
             }
        case 'LOGIN_SUCCESS':
             console.log('success');
             
             return {
            ...state,
            authError:null
            
             }
        case 'SIGNOUT_SUCCESS':
             console.log('signout');
             return state;
        
        default:
             return state;
    }
   
}

export default authReducer;
